import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'dragula/dist/dragula.min.css';
import {Dragula} from 'dragula';


import { Container, Card, ListGroup, Button} from 'react-bootstrap';

class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button yahshjkas fash fkjdsg kjdshg jkhsdag fhjsdag hfjdsg fkhads f gh hjkdsa fdsag"
     };



     handleChange = event => {
        this.setState({ username: event.target.value });
      };

    render() { 
        return ( 
        <div>
            <Container fluid>
            <Card
                bg={'info'}
                style={{ width: '18rem' }}
                className='rounded-0 mb-2 text-center'
            >
            <Card.Header>What the world <br></br><b>NEEDS</b></Card.Header>
            <Card.Body>
            <Card.Text>
                <form>
                <label htmlFor="username"></label>
                <input
                type="text"
                style={{ backgroundColor: 'info' }}
                autocomplete="off"
                name="username"
                value={this.state.username}
                onChange={this.handleChange}
                />
                </form>
            </Card.Text>
            </Card.Body>
            </Card>

            <Card
                bg={'success'}
                style={{ width: '18rem' }}
                className="rounded-0 mb-2 text-center"
            >
            <Card.Header>What you are <br></br><b>GOOD AT</b></Card.Header>
            <Card.Body>
            <Card.Text>
                Some quick example text to build on the card title and make up the bulk
                of the card's content.
            </Card.Text>
            </Card.Body>
            </Card>
            <h3>Your sername is: {this.state.username}</h3>
            </Container>
        </div>
        );
    }
}

export default Far;
